    return (
      <section className="splash">
        <Row className="w-100 justify-content-center">
          <Col className="p-0">
            <img className="splash-1" src="/static/images/splash-1.jpg" w/>
          </Col>
          <Col className="p-0">
            <img className="splash-2" src="/static/images/splash-2.jpg" w/>
          </Col>
        </Row>
        <button className="button-1">&lt;</button>
        <button className="button-2">&gt;</button>
      </section>
    );
  }
}
